import React from "react";
import "../style/Company.css";
import { logo } from "../images/logo.png";

export const Company = () => {
    return (
        <div className="container justify-content-center align-items-center Container">
        <h1>Company Page </h1>
        <img src={logo} width="50px" />
        </div>
    );
}
